import React from 'react';

function Education() {
  return (
    <section id="education">
      <h2>Education</h2>
      <div className="education-item">
        <h3>University of Missouri Kansas City</h3>
        <p>Master's in Computer Science</p>
        <p>Kansas City, USA | Jan 2024 - Present</p>
      </div>
      <div className="education-item">
        <h3>Sri Venkateshwara University</h3>
        <p>Bachelor's in Computer Science and Engineering</p>
        <p>Tirupati, India | Aug 2016 - Sep 2020</p>
      </div>
    </section>
  );
}

export default Education;
